import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';
import Login from './pages/Login';

function App() {
  return (
    <Router>
        <Route path='/' component={Login}></Route>
    </Router>
  );
}

export default App;
